window.bookSummaryJSON = "<p>Trapped in the wilderness of Norway, he became both my protector and predator.</p> <p>When I set off to the remote wilderness of Norway for my atmospheric research, I envisioned rain drenched landscapes and fierce weather patterns, not the brooding and dangerously attractive hunter, Aksel.</p> <p>Initially, I admired his rugged intensity, but I soon uncovered the darkness lurking beneath his captivating blue-gray eyes. Trapped in his isolated cabin in a foreign land, I'm forced to navigate not only the unforgiving elements but also Aksel's possessive and primal desires.</p> <p>As days blur into nights marked by raw passion and startling revelations, I find myself caught in a tumultuous struggle between fear and an undeniable yearning for the man who has claimed me.</p> <p>With my professional dreams clashing against Aksel’s animalistic need to protect and possess, I must decide whether to embrace the wild freedom he offers or to find a way back to the life I once knew.</p> <p>In a place where love and danger intertwine, can I survive Aksel’s savage past and emerge unscathed, or will I become his willing prey?</p> <p>Hunted is a 47k word dark romance with heavy subjects that some listeners may find triggering. A full list of the warnings will be found in the book. This story has no cliffhanger, no cheating and ends with a HEA.</p>"; 
